import React from 'react';
import './styles.css'; // Ensure you have your CSS here

const Footer = () => {
  return (
    <footer id="footer" className="bg-dark text-white mt-5">
      <div className="container text-center py-4">
        <p>&copy; 2024 MEDIASSIST</p>
        <h4>Contact Us</h4>
        <p>Email: contact@mediassist.com</p>
        <p>Phone: +91-22-1234-5678</p>
        <p>Address: Bandra, Mumbai, Maharashtra, India</p>
      </div>
    </footer>
  );
}

export default Footer;
